package cli

import (
	"strings"
	"time"
)

var oui map[string]string
var minOUILen, maxOUILen int

func init() {
	oui = make(map[string]string)
	minOUILen = 999
	maxOUILen = 0
	for _, m := range strings.Split(MACOUI, "\n") {
		kv := strings.SplitN(m, ",", 2)
		if len(kv) != 2 {
			continue
		}
		mac := strings.ToUpper(strings.TrimSpace(kv[0]))
		org := strings.TrimSpace(kv[1])
		lm := len(mac)
		if lm > 0 && len(org) > 0 {
			oui[mac] = org
			if lm > maxOUILen {
				maxOUILen = lm
			}
			if lm < minOUILen {
				minOUILen = lm
			}
		}
	}
}

func getOUI(ip string, timeout time.Duration) (org string) {
	mac, _ := getMAC(ip, timeout)
	if mac == "" {
		return ""
	}
	mac = strings.ToUpper(mac)
	l := maxOUILen
	for {
		pfx := mac[:l]
		org = oui[pfx]
		if org != "" {
			return " (" + mac + ", " + org + ")"
		}
		l--
		if l < minOUILen {
			break
		}
	}
	return " (" + mac + ")"
}

